    function encontrarNumero($palavra, $matrix)
{
    foreach ($matrix as $key => $item) {
        if (isset($item[$key]) && $item[$key] === $palavra) {
            return $key + 1;
        }
    }

    return null;
}


function encontrarPalavra($numero, $matrix)
{
    $numero = $numero -1;
    foreach ($matrix as $key => $item) {
        if(isset($item[$numero])){
            return $item[$key];
        }
    }

    return null;
}



